import React from "react";
import NotificationList from '../components/NotificationList';

const Notification = () => {
    const NOTIF = [
        {
            id:"1",
            type: "Like",
            userID: "Julie",
            date: "12/03/20"
        }
    ]
    return <NotificationList items={NOTIF} />;
};

export default Notification;
